import React, {Component} from "react";
import CARD from "./Cardreact";

class Cards extends Component {
    render() {
        return (
            <div className="container-fluid d-flex justify-content-center">
                <div className="row">
                    <div className="col-md-4">
                        <CARD name="Leanne Graham" nickname="Bret" website=""/>
                    </div>
                    <div className="col-md-4">
                        <CARD name="Ervin Howell" nickname="Antonette" website=""/>
                    </div>
                    <div className="col-md-4">
                        <CARD name="Clementine Bauch" nickname="Samantha" website=""/>
                    </div>
                </div>
            </div>
        )
    }
}

export default Cards;
